import React from 'react';
import './App.css';

function App() {
    return (
        <div id="tg-loader-wrapper">
            <div id="tg-loader"></div>
            <div class="tg-loader-section loader-section-left"></div>
            <div class="tg-loader-section loader-section-right"></div>
        </div>
  );
}

export default App;
